window.onresize = function() {
    if (document.querySelector('.new-xcenter-home-menu') != null && document.querySelector('.new-xcenter-home-menu').classList.contains('app-open') == false) {
        prepareNav()
        setTimeout(() => {
            document.getElementById('navbar-other').classList.remove('navbuttonextend');
            if (document.querySelector('.navbuttonextend') != null) {document.querySelector('.navbuttonextend').classList.remove('navbuttonextend')}
            var page = lastSwitchedPage;
            if (page == 'index') page = '';
            if (document.getElementById('/' + page + '/') != null) {
                document.getElementById('/' + page + '/').classList.add('navbuttonextend');
            } else if (page.length < 1) {
                document.getElementById('/').classList.add('navbuttonextend');
            } else {
                var pagelink = page;
                pagelink = pagelink[0].toUpperCase() + pagelink.substring(1)
                document.getElementById('navbar-other').innerHTML = '<img src="data:image/png;base64,">' + pagelink + '';
                document.getElementById('navbar-other').classList.add('navbuttonextend');
            }
        }, 50)
    }
}
if (localStorage.getItem('XCenterAfterSetup') == null && location.href.indexOf('file:///') != -1) {
    for (let i = 0;i != 33;i++) {
        localStorage.removeItem('XCenterAppData' + i);
        app.reloadApps();
    }
    localStorage.setItem('XCenterAfterSetup', 'true');
} else if (localStorage.getItem('XCenterAfterSetup') != null && location.href.indexOf('file:///') === -1) {
    localStorage.removeItem('XCenterAfterSetup');
}
